import React, { useState } from 'react';
import { PrimaryNav, MenuLink, Menu, Hamburger } from './NavElement'
import { Link } from 'react-router-dom';

const RegistrationFormComponent = () => {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Registracija uspješna');
    console.log('Korisničko ime:', username);
    console.log('Email:', email);
    console.log('Lozinka:', password);
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Korisničko ime:
        <input type="text" value={username} onChange={(e) => setUsername(e.target.value)} />
      </label>
      <br />
      <label>
        Email:
        <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />
      </label>
      <br />
      <label>
        Lozinka:
        <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} />
      </label>
      <br />
      <button type="submit">Registracija</button>
    </form>
  );
};

const Navbar = () => {
  const [showRegistrationForm, setShowRegistrationForm] = useState(false);

  const handleRegisterClick = () => {
    setShowRegistrationForm(true);
  };

  return (
    <>
      <PrimaryNav>
        <Hamburger />
        <Menu>
          <MenuLink to="/home" activeStyle>
            Home
          </MenuLink>
          <MenuLink to="/about" activeStyle>
            About
          </MenuLink>
          <MenuLink to="/products" activeStyle>
            Products
          </MenuLink>
          <li>
            <Link to="/login">Login</Link>
          </li>
          <li>
            <Link to="/register" onClick={handleRegisterClick}>
              Register
            </Link>
          </li>
        </Menu>
      </PrimaryNav>
      {showRegistrationForm && <RegistrationFormComponent />}
    </>
  );
};

export default Navbar;
